from collections import defaultdict


class UndergroundSystem:

    def __init__(self):
        self.stations = defaultdict(dict)
        self.ids = defaultdict(list)

    def checkIn(self, id: int, stationName: str, t: int) -> None:
        self.ids[id].append((stationName, t))

    def checkOut(self, id: int, stationName: str, t: int) -> None:
        for station_from, start_time in self.ids[id]:
            if stationName in self.stations[station_from]:
                self.stations[station_from][stationName].append(t - start_time)
            else:
                self.stations[station_from][stationName] = [t - start_time]
        # del self.ids[id]

    def getAverageTime(self, startStation: str, endStation: str) -> float:
        times = self.stations[startStation][endStation]
        return sum(times)/len(times)


