def checking(funcs, data, output):
    my_obj = None
    my_out = []

    for command, input in zip(funcs, data):

        if command == "UndergroundSystem":
            my_obj = UndergroundSystem()
            my_out.append(None)
        else:
            func = eval('my_obj.' + command)
            my_out.append(func(*input))

    test = ''
    for out1, out2 in zip(output, my_out):
        if out2:
            out2 = round(out2, 5)
        passed = out1 == out2
        if not passed:
            test = 'not '            
        equal = '==' if passed else '!='
        print(f'{out1} {equal} {out2}. Test passed: {passed}')
    print(f'\nTest {test}passed')
    print('\n--------------------------------------------------------------------------------\n')


